            display: flex;
            justify-content: space-evenly;
            align-items: center;

            @include mobile-only {
                display: flex;
                flex-direction: column;
            }

            li {
                margin-top: 20px;
                font-size: 50px;
                font-family: 'Pacifico', cursive;
                letter-spacing: 5px;

                @include mobile-only {
                    font-size: 36px;
                }

                a {
                    text-decoration: none;
                    color: #212E53;
                    transition: 0.3s;

                    &:hover {
                        cursor: pointer;
                        color: #fff;
                        text-shadow: 0 0 5px #03e9f4,
                            0 0 25px #03e9f4,
                            0 0 50px #03e9f4,
                            0 0 100px #03e9f4;
                    }
                }
            }


        }

    }
}

